//流程启动
import request from '@/utils/request';
export function getModelTree(category) {
  //获取树
  return request({
    url: "/workflow/actExtModel/tree/".concat(category),
    method: 'get'
  });
} //扩展流程定义视图查询

export function getViewData(query) {
  return request({
    url: "/workflow/actExtProcdef/view",
    method: 'get',
    params: query
  });
} //扩展流程定义视图查询

export function processStart(prodefId, data) {
  return request({
    url: "/workflow/actProInstance/".concat(prodefId, "/start"),
    method: 'post',
    data: data
  });
}
